import React from "react";
import { Box, Container, Text } from "@chakra-ui/react";
function HomePage() {
  return (
    <div>
      <Container maxW="xl" centerContent>
        <Box
          d="flex"
          justifyContent="center"
          p={3}
          bg="white"
          w="100%"
          m="40px 0 15px 0"
          borderRadius="lg"
          borderWidth="1px"
        >
          <Text fontSize="4xl">Tiny Talks</Text>
        </Box>
        <Box></Box>
      </Container>
    </div>
  );
}

export default HomePage;
